                                            Pandemi döneminde kargo firmalarındaki yoğunluğun artması nedeniyle siparişlerin teslimatında kısa süreli gecikmeler yaşanabilmektedir. Anlayış ve sabrınız için teşekkür ederiz.


                                            Değişim Koşulları


                                            skechers.com.tr 'den alınan ürünler için, online mağazamızdan değişim işlemi yapılmamaktadır. Faturası kesilmiş ve tarafına teslim edilmiş ürünler için; faturan ile birlikte belirli Skeche");
            WriteLiteral(@"rs mağazalarımızdan renk, beden veya yeni ürün değişikliği yapabilirsin. Farklı satış kanallarından yapılan alışverişlerde, Skechers mağazalarından değişim yapılmamaktadır.

                                            *Siparişindeki ürünün tutarı yeni ürün tutarı ile aynı ise direk değişim yapılır.


                                            *Yeni ürün tutarı siparişindeki ürünün tutarından az ise aradaki tutar iade çeki olarak tarafına verilir. Bu çeki belirli Skechers mağazalarımızdan veya skechers.com.tr’de kullanabilirsin.


                                            *Yeni ürün tutarı siparişindeki ürün tutarından fazla ise aradaki fark, tarafından tahsil edilir.

                                            İade Koşulları

                                            Kullanılmamış ve ambalajı zarar görmemiş olması şartıyla, “ürün iade formu”nu doldurarak E-İrsaliye veya E-Fatura birlikte, iade şartlarına uyması durumunda sana ulaştığı tarihten itibaren 30 gün içerisinde MNG kargo ile ücretsi");
            WriteLiteral(@"z olarak tarafımıza gönderebilirsin. Kullanılmış, ambalajı açılmış veya benzeri nedenlerle orijinalliğini kaybetmiş ürünlerin iadesi kabul edilmemektedir. Farklı satış kanallarından yapılan alışverişlerde Skechers mağazalarından iade yapılmamaktadır.

                                            Gelen ürün öncelikle Skechers inceleme ekibi tarafından incelenir. Skechers inceleme ekibi üründe ve ambalajında herhangi bir açılma, bozulma, kırılma, tahrip, yırtılma ve kullanılma durumu tespit ederse ürünü iade almayacak ve bedelini iade etmeyecektir.

                                            İade ettiğin ürün bize ulaştığında ve onaylandığında, tarafına e-posta bilgilendirmesi yapılacaktır. İade şartlarına uyması durumunda, 10 iş günü içerisinde ürün tutarı siparişi vermiş olduğunuz kartınıza iade edilir. Taksitli yaptığınız alışverişlerde Skechers bankanıza tek seferde ödeme yapar, bankanız tarafınıza bu ödemeyi taksitli olarak gerçekleştirir.

                                            İadeni istersen ");
            WriteLiteral(@"iade çeki almak koşulu ile belirli Skechers mağazalarımızdan da gerçekleştirebilirsin. Mağazadan iade etmen durumunda siparişindeki ürünün tutarı tarafına iade çeki olarak verilir. Bu çeki belirli Skechers mağazalarımızdan veya skechers.com.tr’de kullanabilirsin. Mağazalarımızda kredi kartına iade yapılmamaktadır.

